import React from "react";
import "./style.css"

function Logo() {
    return (

            <div className="logo">
                <img className="logo-position" src="http://icons.iconarchive.com/icons/itzikgur/my-seven/512/Books-1-icon.png" />
                <h1 className="logo-text logo-position"> What Would You Like To Read? </h1>

            </div>
    )
}

export default Logo;
